function save(){var n=[];$.each($("#member-container tr"),function(t,i){let r=$(i).data("lang"),u=$(i).find("input").first().val();n.push({language:r,name:u})});$("#Input_Names").val(JSON.stringify(n))}$("document").ready(function(){$.ajax({url:"/admin/languages?handler=list",type:"get",dataType:"json",success:function(n){$.each(n,function(n,t){let i=document.getElementById("entry-template").innerHTML,r=Handlebars.compile(i);$("#member-container").append(r(t))});prevTranslations!=null&&$.each(prevTranslations,function(n,t){$(`#member-container tr[data-lang="${t.language}"]`).find("input").val(t.name)})}})});